#include <stdio.h>
#include <stdlib.h>
#include <string.h>

void quick_sort(int s[],int l,int r)
{
    if (l < r)
    {
        int i=l,j=r,x=s[l];
        while(i<j)
        {
            while(i<j && s[j]>=x)
                j--;
            if(i<j)
                s[i++]=s[j];

            while(i<j && s[i]<=x)
                i++;
            if(i<j)
                s[j--]=s[i];

        }

        s[i]=x;
        quick_sort(s,l,i-1);
        quick_sort(s,i+1,r);
    }
}

void solution(char *line)
{
	int s[102400];
	int i, j, tmp;
	int a, b, c, d, n = 0, left = 0, pos = 0, count = 0;

	memset(s, 0, sizeof(s));

	while (1) {
		s[n++] = atoi(line);
		line = strstr(line, ",");
		if (!line)
			break;
		else
			line++;
	}

	quick_sort(s, 0, n-1);

	left = n;
	while (left > 0) {
		if (left >= 4) {
			a = s[0];
			b = s[1];
			c = s[n - 2 - pos];
			d = s[n - 1 - pos];
			if (a + c < b + b)
				count += a + a + c + d;
			else
				count += a + b + b + d;

			pos += 2;
			left -= 2;
		} else if (left == 3) {
			a = s[0];
			b = s[1];
			c = s[2];
			count += a + b + c;
			left -= 3;
		} else if (left == 2) {
			a = s[0];
			b = s[1];
			count += b;
			left -= 2;
		} else if (left == 1) {
			a = s[0];
			count += a;
			left--;
		}
	}
	printf("%d\n", count);
}

